column22:
ყურადღება უნდა გამახვილდეს სკოლაში პროგრამირების საფუძვლებზე;
დამსაქმებლები მეტად ინფორმირებულები უნდა იყვნენ ჩვენს საქმიანობაზე;
თბილისის გარეთ ვინც მუშაობს(თუ ასეთი სამსახური მოიძია საკუთარ ქალაქში), მათთვის ანაზღაურება გაცილებით დაბალია(საკუთარი გამოცდილებით), რაც ასევე პრობლემა მგონია.
